import React from 'react';
import './Fondo.css';  // Asegúrate de importar tu archivo de estilos

const FondoAnimado = () => {
  return (
    <div className="hero">
      <div className="background-animation"></div>
      <div className="content-over-background">
        <div className="cube"></div>
        <div className="cube"></div>
        <div className="cube"></div>
        <div className="cube"></div>
        <div className="cube"></div>
        <div className="cube"></div>
      </div>
    </div>
  );
};

export default FondoAnimado;
